$.aj_=function(){var s=t.s
return A.a([A.a(["In Canada, the canoe has long been associated with the fur trade and the romantic figure of the voyageur."],s),A.a(["The maple leaf is one of the most recognizable symbols of Canada and is featured on the national flag."],s),A.a(["Inuit live throughout most of Northern Canada in the territory of Nunavut."],s),A.a(["The official tartan for Canada as a whole is known as the Maple leaf tartan."],s),A.a(["Igloo comes from the Inkuktitut word \u201ciglu\u201d meaning house."],s),A.a(["Hoser is a slang word for a Canadian of limited intelligence."],s),A.a(["Canada produces 71% of the world's maple syrup, 91% of it coming from Quebec."],s),A.a(["Canadian bacon comes from the loin of the pig instead of the side or belly."],s),A.a(["Canadians apologize so much, Canada passed the Apology Act in 2009."],s),A.a(["There are more than 33 species of whale that live in Canada's oceans."],s),A.a(["One of Canada's most famous nicknames is the Great White North."],s),A.a(["This word is a humorous (though incorrect) take on the Canadian accent saying the word \u201cabout\u201d"],s),A.a(["Banff was declared a UNESCO World Heritage Site in 1984."],s),A.a(["About 28 million litres of water travel down Niagara Falls every second."],s),A.a(["The word totem comes from the Algonquian word \u201codoodem\u201d meaning \u201chis kinship group\u201d."],s),A.a(["Queen Elizabeth II has been Canada's monarch for over 70 years."],s),A.a(["Loons have beautiful, crimson red eyes, but this is only during mating season."],s),A.a(["The M\xe9tis invented the york boat, used by the Hudson's Bay Company to carry furs and trade goods along waterways."],s),A.a(["Toque (or tuque) is the official name for a winter hat in Canada!"],s),A.a(["The 202 km of Rideau Canal with 47 locks is the oldest, continuously operated canal system in North America."],s),A.a(["Canada has the 3rd largest oil reserves in the world and is the 4th largest oil producer and exporter."],s),A.a(["A subspecies known as \u201cgiant\u201d Canada geese are the largest geese in the world."],s),A.a(["Canada has more lakes than the rest of the world combined! Almost 9% of Canada's total surface area is covered by freshwater."],s),A.a(["As of 2019, there were 47 Crown corporations in Canada, including CBC, Canada Post, VIA Rail, the Royal Canadian Mint, and the Bank of Canada."],s),A.a(["PEI produces more potatoes for Canada than any other province and produces 2.5 billion lbs (1.1 million tonnes) per year globally!"],s),A.a(["Roots Canada opened its first store in 1973 selling footwear, and started using the beaver logo in 1985 with the launch of their athletic brand."],s),A.a(["On February 10, 1999, Tahtsa Lake, British Columbia got hit with 145 cm (4'9\") of snow in ONE day!"],s),A.a(["Yukon is home to Mount Logan, Canada's tallest mountain (5959 m) and the 2nd highest peak in North America."],s),A.a(["Canada is home to about 16,000 polar bears, which is approximately two-thirds of the world's total estimated population."],s),A.a(["Bison are North America's largest land animal, with bulls weighing up to 2000 lbs (900 kg) and cows up to 1000 lbs (450 kg)."],s),A.a(["Toronto's CN Tower held the record for the world's tallest free-standing structure for 32 years, from 1975 until 2007."],s),A.a(["Roughly half of the world's Grizzly Bears (a Brown Bear subspecies) live in Canada, mostly in BC."],s),A.a(["One of the NHL's founding teams, the Toronto Maple Leafs have won 13 Stanley Cups, the most recent being in 1967."],s),A.a(["Close to half of all Canadian wheat is grown in Saskatchewan, followed by Alberta and Manitoba."],s),A.a(["There\u2019s a whopping 48 National Parks and over one thousand Provincial and Territorial parks in the Great White North!"],s),A.a(["Kayaks were originally designed for hunting and fishing. In fact, the word kayak means \u201chunter's boat\u201d, and came from \u201cqajaq\u201d or \u201cqayarq\u201d, a Greenlandic Inuit word."],s),A.a(["The moose is the largest species of deer in the world. The average weight of a fully grown male moose (a bull) is 1500 lbs (680 kg)!"],s),A.a(["Since 2016, the month of June has been declared Pride Month in Canada to celebrate the LGBTQ2+ community."],s),A.a(["The Rocky Mountains, also known as the Rockies, are the largest mountain system in North America!"],s),A.a(["Scoff is Newfoundland slang for a big feed, typically Jiggs dinner but could be any large, satisfying meal."],s),A.a(["Cabin is another name for a cottage, and Canada has no shortage of weekend getaway spots!"],s),A.a(["Canadians spent $9.2 billion on beer in 2020 ($325 per adult), which equates to 2.3 billion litres of beer."],s),A.a(["Originally created by the Inuit to keep warm in the Canadian Arctic, the first parkas were made from whale, seal or caribou skin and often coated with fish oil for waterproofing."],s),A.a(["In the 2020/21 season, there were 2,860 indoor and 5,000 outdoor ice hockey rinks located in Canada according to the International Ice Hockey Federation."],s),A.a(["Canadians consumed over 240,000 metric tonnes of frozen fries in 2019."],s),A.a(["Canada has the longest coastline in the world, measuring 243,042 km!"],s),A.a(["The Order of Canada is how our country honours people who make extraordinary contributions to the nation."],s),A.a(["In 1876, Scottish-born inventor Alexander Graham Bell patented the first practical telephone, a concept that he conceived in Brantford, Ontario."],s),A.a(["The white birch is the most widely distributed of native birch trees, and grows in every region of Canada. The bark has long been used for making canoes and ornaments."],s),A.a(["Canada is home to numerous ports, but the Port of Vancouver is Canada's largest port, and is the most diversified port in North America."],s),A.a(["The Dairy Farmers of Canada logo guarantees a product is made with 100% Canadian milk and milk ingredients, and is free of antibiotics."],s),A.a(["Skate Canada is the oldest and largest figure skating organization in the world."],s),A.a(["In 2020, roughly 1 out of every 9 Canadian jobs was in the agriculture and agri-food sector."],s),A.a(["Annually, Canada\u2019s Rivers discharge 7% of the world\u2019s renewable water supply at a flow rate per second more than four times that of Niagara Falls."],s),A.a(["Canada's official national sports are ice hockey (winter) and lacrosse (summer)."],s),A.a(["The Globe and Mail newspaper originated from two competing newspapers, \u201cThe Globe\u201d and \u201cThe Mail and Empire\u201d."],s),A.a(["Poutine (fries topped with cheese curds and gravy) is popular all over Canada and as such it is considered the country's national dish."],s),A.a(["Four species of foxes live in Canada: arctic, swift, grey, and red being the most common. The grey fox is one of only 2 members of the dog family that can climb trees."],s),A.a(["Canada is the world\u2019s largest grower and exporter of flax seed, canola, oats, mustard seeds, pulses (peas, beans, and lentils) and durum wheat."],s),A.a(["Over 5.7 million Canadian adults camp each year and the camping industry contributes a total of $4.7 billion annually to Canada's economy."],s),A.a(["The Calgary Stampede, Canada's largest rodeo, is billed as \u201cThe Greatest Outdoor Show on Earth\u201d. It is held every July and turns 110 years old in 2022."],s),A.a(["Canada\u2019s three biggest trading partners are the United States, the European Union and China. Goods and services trade with the US totaled over $800 billion in 2021."],s),A.a(["Canada consistently ranks in the top 10 most peaceful countries in the world according to the Global Peace Index (GPI). The Peace Tower also forms the centrepiece of the Canadian parliament buildings."],s),A.a(["In 2020, Canada produced 60 minerals and metals at almost 200 mines, and the value of Canada's mineral production reached $43.8 billion."],s),A.a(["The shores of Canada's 52,455 islands are a big part of what makes the country's coastline the longest in the world."],s),A.a(["Canada has the world\u2019s largest stock of standing western redcedar trees. The western redcedar is the arboreal emblem of the province of British Columbia."],s),A.a(["With a landmass of almost 10 million square kilometres, Canada is the second-largest country in the world."],s),A.a(["The Brier is the annual Canadian men's curling championship that has been held since 1927. Team Gushue won the 2022 Brier, their fourth championship in six years."],s),A.a(["The highest tides in the world can be found in Canada at the Bay of Fundy, which separates New Brunswick from Nova Scotia."],s),A.a(["A klick is a military term used to denote a distance of one kilometre. It is commonly used in Canada when referring to distance or speed."],s),A.a(["The Canadian Tuxedo is an outfit consisting of a denim jacket or jean shirt worn with denim jeans, or denim-on-denim. The term originated in 1951 after Bing Crosby was refused entry to a Vancouver hotel wearing double denim."],s),A.a(["The most famous ship in Canadian history, the Bluenose, was both a fishing and racing vessel in the 1920s and 1930s. The Nova Scotia schooner achieved immortality when its image was engraved onto the Canadian dime."],s),A.a(["From the last Friday in October to Remembrance Day, millions of Canadians wear a poppy as a visual pledge to never forget those who sacrificed for our freedom."],s),A.a(["The Supreme Court of Canada is the highest court in the judicial system of Canada. It comprises nine justices, whose decisions are the ultimate application of Canadian law."],s),A.a(["A beaver home is called a lodge. Beavers live in wetland habitats along lakes and rivers and are some of the best architects in the wild. Some even call them the original Canadian lumberjacks!"],s),A.a(["With marine waters spanning its west, north, and east coasts, Canada is an ocean nation. Canadians are influenced in many ways by the Pacific, Arctic, and Atlantic Oceans. Celebrate World Oceans Day on June 8th!"],s),A.a(["Buoyed by its inclusion in the 2016 Olympic Games, Rugby is one of the fastest growing team sports in Canada, particularly in youth and women."],s),A.a(["Canada officially uses the metric system of measurement, and metre is the standard spelling of the metric unit for length."],s),A.a(["Elders are respected individuals who play key roles in Indigenous communities. They are important knowledge keepers, and they also help to ensure cultural continuity."],s),A.a(["Canada's contributions to space exploration include one of Canada\u2019s most celebrated and iconic technological advances: The Canadarm - a remote-controlled robotic arm used to help build and maintain the International Space Station (ISS)."],s),A.a(["On April 30, 2002, a bill was passed into law by the Canadian Government making the Canadian horse an official symbol of Canada. The Canadian horse is known for its great strength and endurance, resilience, intelligence and good temper."],s),A.a(["Newfoundland, Canada is widely considered one of the foggiest places on Earth. On average, Newfoundland experiences over 200 foggy days every year."],s),A.a(["Lottery & gambling winnings in Canada are treated as windfalls and are not subject to Canadian income tax. Turns out taxes aren't always certain after all!"],s),A.a(["Canada has a large and well-developed railway system that includes transcontinental freight train services by Canadian National (CN) and Canadian Pacific (CP), and nationwide passenger train services by Via Rail."],s),A.a(["The Canadian music industry is the sixth-largest in the world, producing internationally renowned composers, musicians and ensembles. O Canada!"],s),A.a(["Celebrated annually on November 21st, National Red Mitten Day encourages Canadians to display their patriotism in support of Canadian athletes! Red mittens represent the pride, generosity, and excellence of every Canadian."],s),A.a(["The grain sector is a key driver of Canada's economic growth, exporting 26.4 million tonnes of wheat in 2020-21 and over $25 billion in exports sales."],s),A.a(["In the Canadian Football League (CFL), a rouge is a one-point score that is awarded for certain plays that involve the ball being kicked into the end zone. The rouge is uniquely Canadian!"],s),A.a(["The Canadian Tulip Festival in Ottawa features 100 tulip varieties with more than one million blooms over 14,000 m\xb2. The celebration is a symbol of friendship between Canada and the Netherlands, with 20,000 bulbs being gifted by the Netherlands each year."],s),A.a(["Canadians drink more than 1 billion glasses of Canadian wine every year. Because of our cold climate, Canada is the largest Icewine producer in the world."],s),A.a(["The Royal Canadian Mounted Police, or \u201cMounties,\u201d are known for their iconic uniforms that feature the iconic scarlet tunic called a red serge."],s),A.a(["The Prairie provinces of Alberta, Saskatchewan, and Manitoba are known for being the most rural parts of Canada. Much of the Prairies' population is descended from 19th century farmer-settlers. The percentage of Canadians living in rural areas has gone from 87% in 1851 to 17.8% in 2021."],s),A.a(["The Canadian Armed Forces has personnel deployed across Canada and around the world. Since 1947, Canadian troops have completed 72 international missions."],s),A.a(["The Juno Awards celebrate the best in Canadian music! Anne Murray has won the most Junos with 25 wins (52 nominations), followed by Bryan Adams (21 wins, 63 nominations) and Celine Dion (20 wins, 75 nominations)."],s),A.a(["Canada's best summer Olympic sport is athletics, which includes running, hurdles, long jump, high jump, decathlon and other track & field events. Canada has earned 66 medals in athletics since 1900, including 16 gold, 17 silver and 33 bronze."],s),A.a(["Canada\u2019s North is particularly well-known as being the fabled \u201cland of the midnight sun.\u201d Due to its proximity to the Arctic Circle, northern days can entail up to 24 straight hours of sunlight in the summer. Calgary is the sunniest of Canada's large cities, enjoying an average of 2,400 hours of bright sun each year, spread over 333 days."],s),A.a(["There are six time zones in Canada covering four and a half hours. From west to east these time zones are: Pacific, Mountain, Central, Eastern, Atlantic and Newfoundland. Canada's Sir Sandford Fleming developed the modern system of standard time and time zones, still in use today."],s),A.a(["Canada is home to the two longest freshwater beaches in the world: Wasaga Beach (14 km) on the Georgian Bay in Ontario and Sauble Beach (11 km) on the Bruce Peninsula, along the eastern shore of Lake Huron."],s),A.a(["Approximately 275 Canadian ski areas see more than 19 million visits per season. Canadian skiers and snowboarders (an estimated number of 2.5 million) are on the slopes and trails an average of 7.5 days per year."],s),A.a(["The Ceremonial Guard is an ad hoc military unit in the Canadian Armed Forces that performs the Changing the Guard ceremony on Parliament Hill and posts sentries at Rideau Hall. We stand on guard for thee!"],s),A.a(["The Montreal Expos, named after the Expo 67 World's Fair, were the first Major League Baseball franchise located outside the USA, competing from 1969 until 2004. The last World's Fair held in Canada was Expo 86 in Vancouver."],s),A.a(["Waterpower is Canada's most abundant source of clean and renewable electricity, providing more than 60% of Canada's total electricity today. Canada is the fourth largest generator of hydroelectricity in the world."],s),A.a(["The ","Trans Canada Trail"," is Canada\u2019s national trail and is the longest network of multi-use recreational trails in the world. Crossing Canada on the Trans Canada Trail by foot would take over two years, spanning a whopping 24,134 km!"],s),A.a(["With roughly 22 different species of duck found in Canada, the most common is the Mallard. Saskatchewan is renowned for having some of the most abundant and productive waterfowl habitat in North America. Check out ","Ducks Unlimited Canada"," and how they are working to conserve, restore and manage Canadian wetlands."],s),A.a(["With around 80,423 cubic metres per capita, Canada has about 9% of the world's total renewable fresh water supply. When glacier, underground and lake water is included, Canada actually has 20% of the world's fresh water supply."],s),A.a(["Rain boots, winter boots, cowboy boots, hiking boots, ski/snowboard/snowmobile boots - there is no shortage of boots for Canadians to wear! DYK: The brown leather riding boots worn by the RCMP need to be shined for a minimum of 25 hours before they have the appropriate sheen to them!"],s),A.a(["A butter tart is a delicious pastry tart, which generally consists of butter, sugar, syrup, and egg, filled into a flaky pastry. The earliest published recipe for a butter tart is from Barrie, Ontario dating back to 1900 in the Women's Auxiliary of the Royal Victoria Hospital Cookbook."],s),A.a(["The McIntosh (nicknamed the \u201cMac\u201d) is the national apple of Canada. John McIntosh discovered the original McIntosh sapling on his Dundela farm in Upper Canada in 1811. Many years later, Apple Inc. named the Macintosh computer line after the fruit."],s),A.a(["Invented by Canadian James Naismith in 1891 while he was teaching at the YMCA in Springfield, Massachusetts, basketball is now one of the most popular sports in the world. The first game used a soccer ball and peach baskets as hoops, which gave the sport its name. Basketball was born!"],s),A.a(["The taiga or boreal forest has been called the world's largest land biome. In North America the taiga occupies much of Canada and Alaska. At 1.3 billion acres, the Canadian Boreal Forest is one of the largest intact forest and wetland ecosystems remaining on earth."],s),A.a(["Steel plays an extremely important role in the Canadian economy as a whole: in 2019, the Canadian steel industry contributed $4.2 billion to Canada's GDP. According to the Canadian Steel Producers Association, the Canadian steel industry employs, directly and indirectly, more than 120,000 Canadians."],s),A.a(["The Canada Games is a multi-sport event held every two years, alternating between the Canada Winter Games and the Canada Summer Games. They represent the highest level of national competition for Canadian athletes. The ","Niagara 2022 Canada Summer Games"," will take place Aug 6-21, 2022!"],s),A.a(["Canada is a representative democracy. During an election, all Canadian citizens who are at least 18 years old on election day can vote in their electoral district."],s),A.a(["One of the most widely-known facts about Canada is that we\u2019ve got an abundance of trees, but did you know that Canada actually boasts 30 per cent of the world\u2019s boreal forest and 10 per cent of the world\u2019s total forest cover?"],s),A.a(["There are so many different types of fields in Canada: sports fields, wheat fields, oil fields, and ice fields to name a few. The Canadian Prairies are known for their open skies and vast fields of grain, but Canada is also home to the world's largest non-polar ice field in the St. Elias Mountains located in Kluane National Park and Reserve, Yukon Territory."],s),A.a(["The Prime Minister (PM) is the head of the federal government in Canada. It is the most powerful position in Canadian politics. While the Queen may be Canada's head of state, and the Governor General the Queen's representative, it's the Prime Minister who is known as the nation's head of government."],s),A.a(["Canadians love their potato chips! In 2020, the Canadian potato chips market had total revenues of almost $2 billion. Canada is also home to some truly Canadian original flavours - both Ketchup and All Dressed chips are almost exclusively available in Canada!"],s),A.a(["The telephone pager was invented in 1949 by Canadian Alfred J. Gross, a Toronto-based wireless communications pioneer. The devices Alfred invented also led to cordless and cellular telephone technology."],s),A.a(["Canada has the most donut shops and consumes the most donuts per capita of any other country in the world - around 1 billion annually! The donut-eating capital of Canada is Lloydminster, Alberta/Saskatchewan. National Donut Day was last Friday, June 3rd - we hope you celebrated with your favourite donut!\n\nIn Canada, the preferred spelling is \u201cdoughnut\u201d, but most dictionaries list \u201cdonut\u201d as an acceptable variant. We wanted to include it in the game since the doughnut/donut is considered by some as Canada's unofficial national sugary snack! \ud83c\udf69\ud83c\udf41"],s),A.a(["In 1907, Canadian Peter L. Robertson invented a square socket-head screw. He produced his screws in his Milton, Ontario, factory starting in 1908. At that time, it was a revolutionary change in the fastener industry. Robertson screws and screwdrivers carry his name to this day."],s),A.a(["In many Indigenous cultures in Canada, chiefs are the leaders of bands, clans and/or First Nations. Chiefs act as cultural and spiritual leaders and also serve as links between their people and the municipal, provincial and federal governments. RoseAnne Archibald is the current National Chief of the Assembly of First Nations (AFN) in Canada."],s),A.a(["Canada\u2019s Yukon Territory is home to 8 of Canada\u2019s tallest mountains, with Mount Logan topping them all at 5956m high. BC\u2019s Snow Dome peak is a unique \u201cthree-ocean peak\u201d, where if you poured a cup of water at the summit, the water could flow into the Pacific Ocean to the west, the Arctic Ocean to the north, or the Atlantic Ocean to the east."],s),A.a(["The largest indoor arena in Canada is the Montreal Canadiens\u2019 Bell Centre with a capacity of 21,700. The largest open air stadium is Edmonton\u2019s Commonwealth Stadium, home to CFL\u2019s Edmonton Elks, able to hold 56,302."],s),A.a(["\u201cToboggan\u201d is from the Mi'kmaq word \u201ctobakun,\u201d which means sled. In fact, the Inuit made the first toboggans out of whale bone and used it to transport people and belongings across the snowy tundra. Guy Martin holds the world record for fastest speed on a gravity powered snow sled at over 134 km/h in 2014!"],s),A.a(["The House of Commons of Canada is a democratically elected body whose members are known as members of Parliament (MPs). It is the lower house of the Parliament of Canada (the Senate is the upper house) and provides a link between Canadians and their Parliament. Many laws in Canada first begin as bills in the House of Commons."],s),A.a(["The Montr\xe9al bagel is one of Canada's most iconic and coveted snacks. It is a distinctive variety of handmade bagel that traditionally has a prounounced sweet taste and a chewy and dense texture, and is always baked in a wood-fired oven. The bagel first arrived in Montr\xe9al with the wave of Jewish immigrants from Eastern Europe in the early 1900s."],s),A.a(["The Canadian Armed Forces is the unified military of Canada, including sea, land, and air elements referred to as the Royal Canadian Navy, Canadian Army, and Royal Canadian Air Force. June 5th was Canadian Armed Forces Day - a day to honour and recognize members of the Canadian Armed Forces who display unwavering courage, sacrifice, and selflessness every day they wear the uniform."],s),A.a(["A total of 43 Olympic medals (including 10 gold medals) have been won by Canadian rowers, making rowing Canada's third-most successful summer Olympic sport (behind athletics and swimming)."],s),A.a(["Canadian inventor Reginald A. Fessenden is best known for his pioneering work developing radio technology, including the foundations of amplitude modulation (AM) radio. On 23 December 1900, he was the first person to send audio (wireless telephony) by means of electromagnetic waves, successfully transmitting speech by radio over a distance of about a 1.6 kilometres."],s),A.a(["Canada officially uses the metric system of measurement, and litre is the standard spelling of the metric unit for liquid volume. Canadians purchase gasoline in litres, and also buy milk by the litre (in bags in parts of Ontario, Quebec, and the Maritimes!)."],s),A.a(["Canada is one of the oldest continuing monarchies in the world. The title \u201cRoyal\u201d is a sign of honour and distinction, and the granting of this distinction is a prerogative of the Sovereign. In Canada, we have the Royal Canadian Navy, the Royal Canadian Air Force, the Royal Canadian Regiment in the Canadian Army, the Royal Canadian Mounted Police, the Royal Canadian Legion, the Royal College of Physicians and Surgeons of Canada, and the Royal Architectural Institute of Canada. In Canada's legislative process, a bill can only become law once it has received royal assent."],s),A.a(["Beading has a very long artistic and cultural history among the Indigenous people in Canada. At least 8,000 years before Europeans came to Canada, First Nations people were using beads in elaborate designs and for trade. Today, you can find beautiful First Nations beadwork at powwows, First Nations arts stores and museums across Canada.\n\nJune 21st is National Indigenous Peoples Day. Take the opportunity to learn more about the cultural and linguistic diversity as well as the contributions of First Nations, Inuit and M\xe9tis Peoples."],s),A.a(["The first quartz clock was developed in 1927 by Canadian-born telecommunications engineer Warren Marrison. During the 1940s, time standard laboratories throughout the world switched from mechanical clocks to quartz, and the quartz revolution had begun thanks to Marrison."],s),A.a(["With freshwater lakes, rivers and streams covering almost 9% of the country's total area, Canada is a haven for anglers. Canada is home to many different species of trout, including steelhead, rainbow trout, lake trout, brown trout, cutthroat trout and brook trout. Approximately 25% of the world's lake trout lakes are found in the province of Ontario."],s),A.a(["Hockey and Canada are synonymous with each other, and the sport remains integral to the country\u2019s culture. Hockey sticks go back to the 1800s where sticks were hand carved from a single piece of wood.  The first commercial sticks were said to be created by the Mi\u2019kmaq carvers in Nova Scotia and were made from birch and hornbeam trees."],s),A.a(["Alberta is home to the richest source of dinosaur fossils in the world! The town of Drumheller in the heart of the Canadian Badlands is known as the \u201cDinosaur Capital of the World\u201d and boasts the world's largest dinosaur, a T-Rex standing 25m tall. Just down the road in the Red Deer River valley you'll find Dinosaur Provincial Park, a UNESCO World Heritage site where 58 unique dinosaur species have been discovered."],s),A.a(["Canada is as tall as it is wide, creating a wide range of climate conditions. From blistering cold winters to hot muggy summers; torrential rain, blinding snowstorms, deadly tornadoes and scorching drought, Canadians experience some of the planet's most diverse weather systems. Windsor, Ontario is the thunderstorm capital of Canada and has more lightning strikes than any other major city across the country."],s),A.a(["Pizza is one of the most popular foods in the world, and Canada is no exception. There is even \u201cCanadian pizza\u201d which typically includes tomato sauce, mozzarella cheese, bacon, pepperoni, and mushrooms. The country's biggest claim to pizza fame, however, is that the Hawaiian pizza was invented in Canada in 1962 by Sam Panopoulos, a native of Greece who was running a pizzeria in Chatham, Ontario. Pineapple pizza fans unite! \ud83c\udf4d\ud83e\udd53\ud83c\udf55"],s),A.a(["Maple taffy (tire d'\xe9rable or tire sur la neige in French-speaking Canada) is a sugar candy made by boiling maple sap past the point where it would form maple syrup, but not so long that it becomes maple butter or maple sugar. It is part of traditional culture in Qu\xe9bec, Eastern Ontario, New Brunswick, and Nova Scotia. In these regions, maple syrup is boiled, poured into rows on a snow-lined tray, and rolled onto sticks to make this chewy, irresistible candy."],s),A.a(["Although it is unknown who coined the term \u201cGreat White North\u201d in reference to Canada, the nickname has been in use for many decades. \u201cGreat\u201d because it\u2019s the second largest country in the world. \u201cWhite\u201d because of the amount of Arctic frozen tundra and snow within the country. Finally, \u201cNorth\u201d because not only does Canada take up most of the northern half of North America, it also stretches nearly to the North Pole! Canada is also home to the Great Lakes, the largest group of freshwater lakes on Earth, as well as Great Bear Lake and Great Slave Lake in the Northwest Territories."],s),A.a(["According to legend, the first hockey pucks used in early outdoor hockey games were pieces of frozen cow dung. Other early versions were made out of wood cut from the branches of trees. Sometimes even stones would suffice. Around 1875, rubber lacrosse balls were sliced in thirds and only the middle section was kept. Eventually, vulcanized rubber became the standard material used for hockey pucks."],s),A.a(["There is little doubt that Canada is one of the best places to live in the world, and there is a lot to be proud of in this amazing country! A few of the things that make us proud to call the Great White North home: universal health care, a rich ethnic diversity & inclusive culture, gorgeous scenery & landscapes, extraordinary wildlife, delicious food like poutine, butter tarts and maple syrup, real beer, and of course Canada's game, hockey! We feel a deep sense of pride towards this beautiful land and its inhabitants, and can proudly wear the maple leaf wherever we go. True north strong and free! \ud83c\udf41"],s)],A.N("o<t<j>>"))}()
